import { Link } from "react-router-dom";
import logo from "./logo.png";
import { Navbar, Nav } from "react-bootstrap";

const navbar = () => {
  return (
    // <nav className="navbar">
    //   <img src={logo} width="60px"></img>

    //   <h2>NETFLIX & CHILL</h2>

    //   <div className="links">
    //     <Link
    //       to="/movies/1"
    //       id='home'
    //     >
    //       Home
    //     </Link>
    //     {/* <Link
    //       to="/movies/1"
    //       style={{
    //         color: "white",
    //         backgroundColor: "crimson",
    //         borderRadius: "5px",
    //       }}
    //     >
    //       New Blog
    //     </Link> */}
    //   </div>
    // </nav>

    <Navbar id="mainBar" bg="myLight" expand="md" collapseOnSelect>
      <Navbar.Brand>
        <img id="mainLogo" src={logo} width="60px"></img>
      </Navbar.Brand>

      <Nav>
        <h2 className="hidden-xs">NETFLIX & CHILL</h2>
      </Nav>

      <Navbar.Toggle />
      <Navbar.Collapse id="coll">
        <Nav id="barItems">
          <Nav.Link href="#">Home</Nav.Link>
          <Nav.Link id="contactLink" href="#">
            Contact
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  );
};

export default navbar;
